import React, { useState, useEffect } from 'react';
import { 
  PlusIcon, 
  PencilIcon, 
  TrashIcon, 
  MagnifyingGlassIcon,
  UserIcon,
  AcademicCapIcon,
  UserGroupIcon,
  XMarkIcon,
  FingerPrintIcon,
  CpuChipIcon,
  DocumentArrowUpIcon,
  CreditCardIcon
} from '@heroicons/react/24/outline';
import axios from 'axios';
import toast from 'react-hot-toast';
import { useAuth } from '../contexts/AuthContext';

function Users() {
  const { user } = useAuth();
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);
  const [editingUser, setEditingUser] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterType, setFilterType] = useState('all');
  const [filterStatus, setFilterStatus] = useState('all');
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const [testingAttendance, setTestingAttendance] = useState(null);
  const [showUploadModal, setShowUploadModal] = useState(false);
  const [uploadFile, setUploadFile] = useState(null);
  const [uploading, setUploading] = useState(false);
  const [uploadResults, setUploadResults] = useState(null);
  const [previewData, setPreviewData] = useState(null);
  const [showPreview, setShowPreview] = useState(false);
  const [showFingerprintModal, setShowFingerprintModal] = useState(false);
  const [selectedUser, setSelectedUser] = useState(null);
  const [availableFingerprintIds, setAvailableFingerprintIds] = useState([]);
  const [selectedFingerprintId, setSelectedFingerprintId] = useState('');
  const [assigningFingerprint, setAssigningFingerprint] = useState(false);
  const [showRfidModal, setShowRfidModal] = useState(false);
  const [rfidScanMode, setRfidScanMode] = useState(false);
  const [scannedRfidData, setScannedRfidData] = useState('');
  const [manualRfidInput, setManualRfidInput] = useState('');
  const [assigningRfid, setAssigningRfid] = useState(false);
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    email: '',
    password: '',
    user_type: 'student',
    student_id: '',
    faculty_id: '',
    year_level: '',
    department: '',
    status: 'active'
  });

  useEffect(() => {
    fetchUsers();
  }, [currentPage, filterType, filterStatus, searchTerm]);

  const fetchUsers = async () => {
    try {
      setLoading(true);
      const params = new URLSearchParams({
        page: currentPage,
        limit: 20
      });

      if (filterType !== 'all') {
        params.append('type', filterType);
      }
      if (filterStatus !== 'all') {
        params.append('status', filterStatus);
      }
      if (searchTerm) {
        params.append('search', searchTerm);
      }

      const response = await axios.get(`http://localhost:5000/api/users?${params}`, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });

      setUsers(response.data.users);
      setTotalPages(response.data.pagination.pages);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_90_6_90_51_11`,'Error fetching users:', error));
      toast.error('Failed to load users');
    } finally {
      setLoading(false);
    }
  };

  const handleTestAttendance = async (userId, authMethod = 'RFID') => {
    try {
      setTestingAttendance(userId);

      const response = await axios.post(
        `http://localhost:5000/api/users/${userId}/test-attendance`,
        { 
          authMethod: authMethod,
          location: 'inside'
        },
        {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        }
      );

      const { attendance } = response.data;

      toast.success(
        <div>
          <div className="font-medium"> Attendance Recorded!</div>
          <div className="text-sm mt-1">
            <div><strong>{attendance.user}</strong></div>
            <div>{attendance.subject} - {attendance.room}</div>
            <div>Status: <span className={`font-medium ${
              attendance.status === 'Present' ? 'text-green-600' : 
              attendance.status === 'Late' ? 'text-yellow-600' : 'text-red-600'
            }`}>{attendance.status}</span></div>
            <div>Auth: {attendance.authMethod}</div>
          </div>
        </div>,
        { duration: 4000 }
      );
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_130_6_130_55_11`,'Error testing attendance:', error));
      toast.error(error.response?.data?.message || 'Failed to record test attendance');
    } finally {
      setTestingAttendance(null);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      if (editingUser) {
        await axios.put(`http://localhost:5000/api/users/${editingUser.USERID}`, formData, {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        });
        toast.success('User updated successfully');
      } else {
        await axios.post('http://localhost:5000/api/users', formData, {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        });
        toast.success('User created successfully');
      }

      setShowModal(false);
      setEditingUser(null);
      resetForm();
      fetchUsers();
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_158_6_158_48_11`,'Error saving user:', error));

      if (error.response?.status === 409) {
        // Handle conflict errors with more specific messages
        const errorMessage = error.response?.data?.message || 'User information conflicts with existing data';
        toast.error(errorMessage);
      } else if (error.response?.status === 400) {
        // Handle validation errors
        const errorMessage = error.response?.data?.message || 'Please check your input data';
        toast.error(errorMessage);
      } else {
        toast.error(error.response?.data?.message || 'Failed to save user');
      }
    }
  };

  const handleEdit = (user) => {
    setEditingUser(user);
    setFormData({
      first_name: user.FIRSTNAME || '',
      last_name: user.LASTNAME || '',
      email: user.EMAIL || '',
      password: '',
      user_type: user.USERTYPE || 'student',
      student_id: user.STUDENTID || '',
      faculty_id: user.FACULTYID || '',
      year_level: user.YEARLEVEL || '',
      department: user.DEPARTMENT || '',
      status: user.STATUS || 'active'
    });
    setShowModal(true);
  };

  const handleDelete = async (userId) => {
    if (!window.confirm('Are you sure you want to delete this user?')) {
      return;
    }

    try {
      await axios.delete(`http://localhost:5000/api/users/${userId}`, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      toast.success('User deleted successfully');
      fetchUsers();
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_203_6_203_50_11`,'Error deleting user:', error));
      toast.error(error.response?.data?.message || 'Failed to delete user');
    }
  };

  const resetForm = () => {
    setFormData({
      first_name: '',
      last_name: '',
      email: '',
      password: '',
      user_type: 'student',
      student_id: '',
      faculty_id: '',
      year_level: '',
      department: '',
      status: 'active'
    });
  };

  const handleFilePreview = async () => {
    if (!uploadFile) {
      toast.error('Please select a file to upload');
      return;
    }

    setUploading(true);
    const formData = new FormData();
    formData.append('excelFile', uploadFile);

    try {
      const response = await axios.post('http://localhost:5000/api/users/preview-excel', formData, {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
          'Content-Type': 'multipart/form-data'
        }
      });

      setPreviewData(response.data);
      setShowPreview(true);
      toast.success(`Preview generated for ${response.data.summary.previewRows} users`);

    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_246_6_246_44_11`,'Preview error:', error));
      toast.error(error.response?.data?.message || 'Failed to preview Excel file');

      if (error.response?.data) {
        setPreviewData(error.response.data);
        setShowPreview(true);
      }
    } finally {
      setUploading(false);
    }
  };

  const handleConfirmUpload = async () => {
    if (!uploadFile) {
      toast.error('Please select a file to upload');
      return;
    }

    setUploading(true);
    const formData = new FormData();
    formData.append('excelFile', uploadFile);

    try {
      const response = await axios.post('http://localhost:5000/api/users/upload-excel', formData, {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
          'Content-Type': 'multipart/form-data'
        }
      });

      setUploadResults(response.data);
      setShowPreview(false);
      setPreviewData(null);
      toast.success(`Successfully processed ${response.data.summary.insertedUsers} users from Excel file`);

      // Refresh the users list
      fetchUsers();

      // Reset upload state
      setUploadFile(null);

    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_288_6_288_43_11`,'Upload error:', error));
      toast.error(error.response?.data?.message || 'Failed to upload Excel file');

      if (error.response?.data?.errors) {
        setUploadResults(error.response.data);
      }
    } finally {
      setUploading(false);
    }
  };

  const handleFileSelect = (event) => {
    const file = event.target.files[0];
    if (file) {
      // Validate file type
      const allowedTypes = ['.xlsx', '.xls', '.csv'];
      const fileExtension = file.name.toLowerCase().substring(file.name.lastIndexOf('.'));

      if (!allowedTypes.includes(fileExtension)) {
        toast.error('Please select a valid Excel file (.xlsx, .xls) or CSV file');
        return;
      }

      // Validate file size (10MB limit)
      if (file.size > 10 * 1024 * 1024) {
        toast.error('File size must be less than 10MB');
        return;
      }

      setUploadFile(file);
      setUploadResults(null);
    }
  };

  const fetchAvailableFingerprintIds = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/users/fingerprint-ids/available', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setAvailableFingerprintIds(response.data.available_ids);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_329_6_329_71_11`,'Error fetching available fingerprint IDs:', error));
      toast.error('Failed to load available fingerprint IDs');
    }
  };

  const handleAssignFingerprint = async (user) => {
    setSelectedUser(user);
    setSelectedFingerprintId('');
    await fetchAvailableFingerprintIds();
    setShowFingerprintModal(true);
  };

  const handleFingerprintAssignment = async () => {
    if (!selectedFingerprintId) {
      toast.error('Please select a fingerprint ID');
      return;
    }

    try {
      setAssigningFingerprint(true);

      const response = await axios.post(
        `http://localhost:5000/api/users/${selectedUser.USERID}/assign-fingerprint`,
        { fingerprint_id: parseInt(selectedFingerprintId) },
        {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        }
      );

      toast.success(
        <div>
          <div className="font-medium"> Fingerprint Assigned!</div>
          <div className="text-sm mt-1">
            <div><strong>{response.data.user.name}</strong></div>
            <div>Fingerprint ID: {response.data.user.fingerprint_id}</div>
            <div>Student ID: {response.data.user.student_id}</div>
          </div>
        </div>,
        { duration: 4000 }
      );

      setShowFingerprintModal(false);
      setSelectedUser(null);
      setSelectedFingerprintId('');
      fetchUsers(); // Refresh the users list

    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_376_6_376_58_11`,'Error assigning fingerprint:', error));
      toast.error(error.response?.data?.message || 'Failed to assign fingerprint');
    } finally {
      setAssigningFingerprint(false);
    }
  };

  // RFID Assignment Functions
  const handleOpenRfidModal = (userData) => {
    setSelectedUser(userData);
    setShowRfidModal(true);
    setRfidScanMode(false);
    setScannedRfidData('');
    setManualRfidInput(userData.RFIDTAG || '');
  };

  const handleStartRfidScan = () => {
    setRfidScanMode(true);
    setScannedRfidData('');
    toast.success('Scan mode activated! Scan an RFID card now...');

    // Focus on a hidden input to capture RFID data
    const hiddenInput = document.getElementById('rfid-scan-input');
    if (hiddenInput) {
      hiddenInput.focus();
    }
  };

  const handleRfidScanInput = (e) => {
    if (e.key === 'Enter' && rfidScanMode) {
      const rfidData = e.target.value.trim();
      if (rfidData.length > 0) {
        setScannedRfidData(rfidData);
        setManualRfidInput(rfidData);
        setRfidScanMode(false);
        toast.success(`RFID captured: ${rfidData}`);
        e.target.value = '';
      }
    }
  };

  const handleAssignRfid = async () => {
    const rfidToAssign = scannedRfidData || manualRfidInput;

    if (!selectedUser || !rfidToAssign.trim()) {
      toast.error('Please provide an RFID code');
      return;
    }

    try {
      setAssigningRfid(true);

      const response = await axios.put(
        `http://localhost:5000/api/users/${selectedUser.USERID}/assign-rfid`,
        { rfid_tag: rfidToAssign.trim() },
        { headers: { Authorization: `Bearer ${localStorage.getItem('token')}` } }
      );

      if (response.status === 200) {
        toast.success('RFID assigned successfully!');
        setShowRfidModal(false);
        setSelectedUser(null);
        setScannedRfidData('');
        setManualRfidInput('');
        fetchUsers(); // Refresh the users list
      }
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`4173443587_443_6_443_51_11`,'Error assigning RFID:', error));
      if (error.response?.status === 400) {
        toast.error(error.response.data.message || 'RFID already in use');
      } else {
        toast.error('Failed to assign RFID');
      }
    } finally {
      setAssigningRfid(false);
    }
  };

  const resetUploadModal = () => {
    setShowUploadModal(false);
    setUploadFile(null);
    setUploadResults(null);
    setPreviewData(null);
    setShowPreview(false);
    setUploading(false);
  };

  const getUserTypeIcon = (type) => {
    switch (type) {
      case 'admin':
        return <UserIcon className="h-5 w-5 text-red-600" />;
      case 'instructor':
        return <AcademicCapIcon className="h-5 w-5 text-blue-600" />;
      case 'student':
        return <UserGroupIcon className="h-5 w-5 text-green-600" />;
      default:
        return <UserIcon className="h-5 w-5 text-gray-600" />;
    }
  };

  const getUserTypeColor = (type) => {
    switch (type) {
      case 'admin':
        return 'bg-red-100 text-red-800';
      case 'instructor':
        return 'bg-blue-100 text-blue-800';
      case 'student':
        return 'bg-green-100 text-green-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  const getStatusColor = (status) => {
    return status === 'active' 
      ? 'bg-green-100 text-green-800' 
      : 'bg-red-100 text-red-800';
  };

  if (loading && users.length === 0) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">User Management</h1>
          <p className="text-gray-600">Manage students, instructors, and administrators. Test attendance simulation available.</p>
        </div>
        {user?.role === 'admin' && (
          <div className="flex space-x-3">
            <button
              onClick={() => setShowUploadModal(true)}
              className="btn btn-secondary flex items-center space-x-2"
            >
              <DocumentArrowUpIcon className="h-5 w-5" />
              <span>Upload CSV/Excel</span>
            </button>
            <button
              onClick={() => setShowModal(true)}
              className="btn btn-primary flex items-center space-x-2"
            >
              <PlusIcon className="h-5 w-5" />
              <span>Add User</span>
            </button>
          </div>
        )}
      </div>

      {/* Filters */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Search</label>
            <div className="relative">
              <MagnifyingGlassIcon className="h-5 w-5 absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
              <input
                type="text"
                placeholder="Search users..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full pl-10 pr-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-1 focus:ring-blue-500"
              />
            </div>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">User Type</label>
            <select
              value={filterType}
              onChange={(e) => setFilterType(e.target.value)}
              className="w-full border border-gray-300 rounded-md px-3 py-2 focus:outline-none focus:ring-1 focus:ring-blue-500"
            >
              <option value="all">All Types</option>
              <option value="student">Students</option>
              <option value="instructor">Instructors</option>
              <option value="admin">Administrators</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-700 mb-1">Status</label>
            <select
              value={filterStatus}
              onChange={(e) => setFilterStatus(e.target.value)}
              className="w-full border border-gray-300 rounded-md px-3 py-2 focus:outline-none focus:ring-1 focus:ring-blue-500"
            >
              <option value="all">All Status</option>
              <option value="active">Active</option>
              <option value="inactive">Inactive</option>
            </select>
          </div>

          <div className="flex items-end">
            <button
              onClick={() => {
                setSearchTerm('');
                setFilterType('all');
                setFilterStatus('all');
                setCurrentPage(1);
              }}
              className="w-full px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
            >
              Clear Filters
            </button>
          </div>
        </div>
      </div>

      {/* Users List */}
      <div className="bg-white rounded-lg shadow">
        <div className="px-6 py-4 border-b border-gray-200">
          <h2 className="text-lg font-semibold text-gray-900">
            Users ({users.length})
          </h2>
        </div>

        {users.length === 0 ? (
          <div className="text-center py-12">
            <UserIcon className="mx-auto h-12 w-12 text-gray-400" />
            <h3 className="mt-2 text-sm font-medium text-gray-900">No users found</h3>
            <p className="mt-1 text-sm text-gray-500">
              {searchTerm || filterType !== 'all' || filterStatus !== 'all'
                ? 'Try adjusting your search or filter criteria.'
                : 'Get started by creating a new user.'
              }
            </p>
          </div>
        ) : (
          <div className="overflow-x-auto">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    User
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Type
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    ID
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Subject/Major
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Status
                  </th>
                  <th className="px-6 py-3 text-center text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Test Attendance
                  </th>
                  {user?.role === 'admin' && (
                    <th className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Actions
                    </th>
                  )}
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {users.map((userData) => (
                  <tr key={userData.USERID} className="hover:bg-gray-50">
                    <td className="px-6 py-4 whitespace-nowrap">
                      <div className="flex items-center">
                        <div className="flex-shrink-0 h-10 w-10">
                          <div className="h-10 w-10 rounded-full bg-gray-200 flex items-center justify-center">
                            {getUserTypeIcon(userData.USERTYPE)}
                          </div>
                        </div>
                        <div className="ml-4">
                          <div className="text-sm font-medium text-gray-900">
                            {userData.FIRSTNAME} {userData.LASTNAME}
                          </div>
                          <div className="text-sm text-gray-500">{userData.EMAIL}</div>
                        </div>
                      </div>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getUserTypeColor(userData.USERTYPE)}`}>
                        {userData.USERTYPE}
                      </span>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                      {userData.STUDENTID || userData.EMPLOYEEID || '-'}
                      {userData.YEARLEVEL && (
                        <div className="text-xs text-gray-500">Year {userData.YEARLEVEL}</div>
                      )}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                      {userData.DEPARTMENT || '-'}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getStatusColor(userData.STATUS)}`}>
                        {userData.STATUS}
                      </span>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-center">
                      <div className="flex items-center justify-center space-x-2">
                        <button
                          onClick={() => handleTestAttendance(userData.USERID, 'RFID')}
                          disabled={testingAttendance === userData.USERID || userData.STATUS !== 'active'}
                          className="inline-flex items-center px-2 py-1 text-xs font-medium text-blue-600 bg-blue-100 rounded-md hover:bg-blue-200 disabled:opacity-50 disabled:cursor-not-allowed transition-colors duration-200"
                          title="Simulate RFID Scan"
                        >
                          {testingAttendance === userData.USERID ? (
                            <div className="animate-spin h-3 w-3 border border-blue-600 rounded-full border-t-transparent"></div>
                          ) : (
                            <CpuChipIcon className="h-3 w-3" />
                          )}
                          <span className="ml-1">RFID</span>
                        </button>
                        <button
                          onClick={() => handleTestAttendance(userData.USERID, 'Fingerprint')}
                          disabled={testingAttendance === userData.USERID || userData.STATUS !== 'active'}
